function SponsoredBills({ sponsoredBills }) {
    return (
        <div>
            { sponsoredBills && (
                <table>
                    <thead>
                        <tr>
                            <th>Introduced</th>
                            <th>Number</th>
                            <th>Title</th>
                            <th>Latest Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {sponsoredBills.map((bill, index) => (
                            <tr key={`bill-${index}`}>
                                <td>{bill.introducedDate}</td>
                                <td>{`${bill.type}-${bill.number}`}</td>
                                <td>{bill.title}</td>
                                <td>`${bill.latestAction.text}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default SponsoredBills;
